require("isomorphic-fetch");

function getTheInfo() {
	return fetch(`http://localhost:3001/api/retrieveText`).then(function(resp) 
	{
		return resp.json();
	});
}

function handleError(error) {
	console.warn(error);
	return null;
}

module.exports = {
	getInfo: function() {
		return getTheInfo().catch(handleError);
	}
};
